import React from "react";



function MealTracker() {
    return (
        <div className="Container">
            <div className="content">
                <p>Stuff related to Meal/Calorie tracking will be accessible here. i.e., Calorie logging for: breakfast, lunch, dinner, snacks, water.
                Save custom meals, etc.</p>
            </div>
        </div>
    );

}

export default MealTracker;
